1.油汚れ・軽い水垢汚れ・タバコのヤニ・ほこりを簡単に洗浄、高級感あふれる光沢に仕上げます。<br>
2.汚れを落とすのと同時にコーティングができるので洗浄剤とコーティング剤をそれぞれ用意する必要がありません。<br>
3.屋外で使用する場合も劣化を起こしにくく最大で約6ヶ月間被膜効果が持続します。(使用する状況によって異なります)<br>
4.従来のワックス・コーティング剤と違い、すべてのプラスチックに使用できます。<br>
5.コーティング被膜の表面が硬化、自動車やバイクなどのボディにキズを付きにくくします。<br>
6.わずかに柑橘系の香りがするだけなので車のダッシュボードや内窓のヤニなど、ルームクリーニングにも使用できます。<br>
7.洗車時のキズ、バフ傷を一時的に隠す効果もあります。<br>
<br>
